package com.chaos.octopus.integrationtests;

import com.chaos.octopus.agent.Agent;
import com.chaos.octopus.commons.core.Job;
import com.chaos.octopus.commons.core.Step;
import com.chaos.octopus.commons.core.Task;
import com.chaos.octopus.commons.core.TestPlugin;
import com.chaos.octopus.server.OrchestratorImpl;
import org.junit.Test;

import static org.junit.Assert.assertEquals;

/**
 * Created by JesperFyhr on 05-03-14.
 */
public class LargeTasksTest {
    @Test
    public void distributeTasksAmongstWorkers_TaskWithALotOfProperties_ExecuteOnOtherWorkers() throws Exception
    {
        try(OrchestratorImpl orch = new OrchestratorImpl(2000);
            Agent agent1 = new Agent("localhost", 2000, 2001, 1);)
        {
            orch.open();
            agent1.addPlugin(new TestPlugin());
            agent1.open();

            TestUtils.waitUntil(new Check() {
                @Override
                public Boolean isTrue() {return orch.getAgents().size() == 1;}
            });

            Job job = make_JobWithTwoTasksWithALargeProperty();
            orch.enqueue(job);

            TestUtils.waitUntil(new Check() {
                @Override
                public Boolean isTrue() {return agent1.getQueueSize() == 1;}
            });

            assertEquals("One task should be queued", 1, agent1.getQueueSize());
        }
    }

    private Job make_JobWithTwoTasksWithALargeProperty()
    {
        Job job = new Job();
        Step step = new Step();
        step.tasks.add(make_TaskWithALargeProperty());
        job.steps.add(step);

        return job;
    }

    private Task make_TaskWithALargeProperty()
    {
        Task task = new Task();
        task.pluginId = "com.chaos.octopus.agent.unit.TestPlugin, 1.0.0";
        StringBuilder sb = new StringBuilder();
        sb.append("");
        sb.append("");
        sb.append("");
        sb.append("");
        sb.append("");
        sb.append("");
        sb.append("");
        sb.append("");
        sb.append("");
        sb.append("");
        sb.append("");
        sb.append("");
        sb.append("");
        sb.append("");

        task.properties.put("large_property", sb.toString());

        return task;
    }
}
